import { Input, Button, Box } from "components";
import React from "react";

export const LoginForm = () => {
  const handleClick = () => {};
  return (
    <Box >
      <div className="bg bg-secondary p-3 mt-3">
        <form className="row g-3">
          <Input />
          <Input />
          <Button label="Click Me" onClick={handleClick} />
        </form>
      </div>
    </Box>
  );
};
